import React from 'react'
import {useNavigate} from 'react-router-dom';

import {EachDetailLi} from "../styled";

const EachProduct = (title, detailID) => {
    const navigate = useNavigate();
    const goDetail = () => {
        navigate(`${'/detail/' + detailID}`);
    }

    return (
        <EachDetailLi onClick={goDetail}>
        <div>
            <h3> {title} </h3>
        </div>
        </EachDetailLi>
    )
}

export default EachProduct
